    private function getProducts($sportId) {
        if($sportId == 121) {
            return array('8311901', '8341670');
        } else {
            return array('8245409', '8307664');
        }
    }
    public function load(ObjectManager $manager)
    {
        foreach($this->getTokens() as $row) {
            $activity = new Activity();
            $activity->setActivityToken($row['token']);
            $decorator = $this->container->get('geonaute_activity.linkdata.manager');

            $activityData = $decorator->getActivityData($row['token']);

            if(!$activityData) {
                continue;
            }

            $activity->setStartdate($activityData['startdate']);
            $activity->setDatasummaries($activityData['datasummaries']);
            $activity->setSportId($activityData['sport_id']);

            $user = $decorator->getUserData($activityData['ldid']);
            $activity->setUser($user);

            $activity->setProductIds($this->getProducts($activityData['sport_id']));

            sleep(1);
            $manager->persist($activity);
        }
        $manager->flush();
    }
